import TheLoop from "../partials/TheLoop";
import Pager from "../partials/Pager";
import { Provider } from "../context/Context";
const Blog = () => {
    return (
        <div>
             <Provider router={props}>
        <div>
            <h1>Home</h1>
            <TheLoop></TheLoop>
            <Pager></Pager>
        </div>
        </Provider>
        </div>
    );
}

export default Blog;
